import Link from 'next/link'

const Button = (props) => {
    return (
        <>
        <div className='container'>
            <Link className ='Button' href={props.href}>
                <a>{props.text}</a>
            </Link>
        </div>
        <style jsx>{`
            .container {
                border: solid 2px gold;
                height: 150px;
                width: 250px;
                display: flex;
                justify-content: center;
                align-items: center;
                background-color: azure;
                margin: 50px
            }
            a {
                color: black;
                text-decoration: none;
            }
        `}</style>
        </>
    )
}

export default Button
